import { BrowserRouter } from 'react-router-dom';
import Home from './pages/Home'
import Routes from './Routes';
import './styles/globals.css'

function App() {
  return (
    <>
      <BrowserRouter >
        <Home />
      </BrowserRouter>

      <Routes />
    </>
  );
}

export default App;
